function add(a,b){
    let sum = a+b ;
    return sum ;
}


function sub(a,b){
    let s = a-b ;
    return s ;
}

function mul(a,b){
    let m = a*b ;
    return m ;
}

function div(a,b){
    let d = a/b ;
    return d ;
}
export default add ;
